      <h2>Contact us</h2>
      <div className="fields">
        <div className="field-container">
          <div className="label-container">
            <span className="material-symbols-outlined label-icon">person</span>
          </div>
          <div className="input-container">
            <input
              type="text"
              className="input"
              placeholder="Full Name"
              name="user_name"
            />
          </div>
        </div>
        <div className="field-container">
          <div className="label-container">
            <span className="material-symbols-outlined label-icon">mail</span>
          </div>
          <div className="input-container">
            <input
              type="text"
              className="input"
              placeholder="Email"
              name="user_email"
            />
          </div>
        </div>
        <div className="field-container">
          <div className="label-container">
            <span className="material-symbols-outlined label-icon">call</span>
          </div>
          <div className="input-container">
            <input
              type="number"
              className="input"
              placeholder="Phone"
              id="contactFormPhone"
              name="phone"
            />
          </div>
        </div>
        <div className="field-container">
          <div className="label-container">
            <span className="material-symbols-outlined label-icon">
              corporate_fare
            </span>
          </div>
          <div className="input-container">
            <input
              type="text"
              className="input"
              placeholder="Organization"
              name="organization"
            />
          </div>
        </div>
        <div className="textarea">
          <label className="title">Message:</label>
          <textarea name="message" className="input"></textarea>
        </div>
      </div>
      <input type="submit" value="Send" className="btn btn-secondary" />
    </form>
  );
};
